// See https://aka.ms/new-console-template for more information
using CodeChallenge;
using CodeChallenge.LeetCode;

var leetCode = new LeetCode();
Log.Title("IsSubsequence");
Log.Should(leetCode.IsSubsequence("abc", "ahbgdc"), "true");
Log.Should(leetCode.IsSubsequence("axc", "ahbgdc"), "false");
Log.Should(leetCode.IsSubsequence("", ""), "true");
Log.Should(leetCode.IsSubsequence("", "ahbgdc"), "true");
Log.Should(leetCode.IsSubsequence("abc", "acb"), "false");
Log.Should(leetCode.IsSubsequence("ab", "baab"), "true");
Log.Should(leetCode.IsSubsequence("leeeeetcode", ""), "true");

Log.Title("MergeTwoLists");
Log.Should(leetCode.MergeTwoLists(new ListNode(new int[] { 1, 2, 4 }), new ListNode(new int[] { 1, 3, 4 })), "[1, 1, 2, 3, 4, 4]");

Log.Title("TwoSum");
Log.Should(leetCode.TwoSum(new int[] { 2, 7, 11, 15 }, 9), "[0, 1]");
Log.Should(leetCode.TwoSum(new int[] { 3, 2, 4 }, 6), "[1, 2]");
Log.Should(leetCode.TwoSum(new int[] { 3, 3 }, 6), "[0, 1]");

Log.Title("ReverseList");
Log.Should(leetCode.ReverseList(new ListNode(new int[] { 1, 2 })), "[2, 1]");
Log.Should(leetCode.ReverseList(null), "[]");


Log.Title("MaxProfit");
Log.Should(leetCode.MaxProfit(new int[] { 7, 1, 5, 3, 6, 4 }), "5");
Log.Should(leetCode.MaxProfit(new int[] { 7, 6, 4, 3, 1 }), "0");
Log.Should(leetCode.MaxProfit(new int[] { 1, 2 }), "1");
Log.Should(leetCode.MaxProfit(new int[] { 2, 4, 1 }), "2");

Log.Title("ContainsDuplicate");
Log.Should(leetCode.ContainsDuplicate(new int[] { 1, 2, 3, 1 }), "true");
Log.Should(leetCode.ContainsDuplicate(new int[] { 1, 2, 3, 4 }), "false");
Log.Should(leetCode.ContainsDuplicate(new int[] { 1, 1, 1, 3, 3, 4, 3, 2, 4, 2 }), "true");

Log.Title("MiddleNode");
Log.Should(leetCode.MiddleNode(new ListNode(new int[] { 1, 2, 3, 4, 5 })), "[3, 4, 5]");
Log.Should(leetCode.MiddleNode(new ListNode(new int[] { 1, 2, 3, 4, 5, 6 })), "[4, 5, 6]");

Log.Title("DetectCycle");
var head = new ListNode(1);
head.next = new ListNode(2);
head.next.next = new ListNode(0);
head.next.next.next = new ListNode(-4, head.next);
Log.Should(leetCode.DetectCycle(head), "2");

var head2 = new ListNode(1);
head2.next = new ListNode(2, head2);
Log.Should(leetCode.DetectCycle(head2), "1");

Log.Should(leetCode.DetectCycle(null), "-1");

var head3 = new ListNode(1);
head3.next = new ListNode(2);
Log.Should(leetCode.DetectCycle(head3), "-1");

Log.Title("LongestPalindrome");
Log.Should(leetCode.LongestPalindrome("abccccdd"), "7");
Log.Should(leetCode.LongestPalindrome("a"), "1");
Log.Should(leetCode.LongestPalindrome("bananas"), "5");
Log.Should(leetCode.LongestPalindrome(""), "983");

Log.Title("ProductExceptSelf");
Log.Should(leetCode.ProductExceptSelf(new int[] { 1, 2, 3, 4 }), "[24, 12, 8, 6]");
Log.Should(leetCode.ProductExceptSelf(new int[] { -1, 1, 0, -3, 3 }), "[0, 0, 9, 0, 0]");

Log.Title("Preorder");
var root = new Node(1, new List<Node>
{
    new Node(3, new List<Node> { new Node(5), new Node(6)}),
    new Node(2),
    new Node(4)
});
Log.Should(leetCode.Preorder(root), "[1, 3, 5, 6, 2, 4]");
var root2 = new Node(1, new List<Node>
{
    new Node(2),
    new Node(3, new List<Node>
    {
        new Node(6),
        new Node(7, new List<Node>
        {
            new Node(11, new List<Node>
            {
                new Node(14)
            }),
        })
    }),
    new Node(4, new List<Node>
    {
        new Node(8, new List<Node>
        {
            new Node(12),
        }),
    }),
    new Node(5, new List<Node>
    {
        new Node(9, new List<Node>
        {
            new Node(13)
        }),
        new Node(10)
    })
});
Log.Should(leetCode.Preorder(root2), "[1, 2, 3, 6, 7, 11, 14, 4, 8, 12, 5, 9, 13, 10]");

Log.Wait();